import Vue from 'vue'
import Router from 'vue-router'

import main from "@/modules/core/components/main.vue";
import dashBoard from "@/modules/admin/components/dashboard.vue";
import Page2 from "@/modules/admin/components/dashboard.vue";

Vue.use(Router)

let router = new Router({
    routes: [
        {
            path: '/',
            name: 'mainPage',
            component: main
        },
        {
            path: '/page2',
            name: 'pageTwo',
            component: Page2
        },
        {
            path: '/admin/references',
            name: 'dashBoard',
            component: dashBoard
        }
    ]
})

export default router
